import React from 'react';

const Grocery = (props) => {
	const a=this.props.price
	let i=0
	i=i+1;

    return (
        <tr onClick={props.click}>
		     <td>{i}</td>
            <td>{props.name}</td>
            <td>{props.quantity}</td>
			<td>Rs{a}</td>
            <td>Rs{props.price}</td>
        </tr>
    )
}

export default Grocery
